import pandas as pd
import numpy as np
import matplotlib.pyplot as plt
import tensorflow as tf
from tensorflow import keras
from keras.layers import Conv2D, Flatten, Dense, MaxPooling2D, Dropout
from keras import Sequential
from keras.datasets import mnist
from tensorflow.keras.models import Model

(x_train, y_train), (x_test, y_test) = keras.datasets.cifar10.load_data()   # importing dataset

x_train.shape, x_test.shape

x_train, x_test = x_train/255.0, x_test/255.0   # Normalization

"""
Label	Description
0	airplane
1	automobile
2	bird
3	cat
4	deer
5	dog
6	frog
7	horse
8	ship
9	truck
"""
class_name = ['airplane','automobile','bird','cat','deer','dog','frog','horse','ship','truck']

import matplotlib.pyplot as plt
plt.figure(figsize=(15,8))
for i in range(25):
  plt.subplot(5,5,i+1)
  plt.xticks([])
  plt.yticks([])
  plt.grid(False)
  plt.imshow(x_train[i], cmap=plt.cm.binary)
  plt.xlabel(class_name[y_train[i][0]])
plt.show()

"""![image.png](data:image/png;base64,)"""

model = tf.keras.applications.ConvNeXtSmall(
    include_top=False,
    weights='imagenet',
    input_shape=(32,32,3),
)

model.trainable=False

x = Flatten()(model.output)
x = Dense(128, activation='relu')(x)
# Dropout
x = Dropout(0.5)(x)
# FCL 2
x = Dense(128, activation='relu')(x)
# Dropout 2
x = Dropout(0.5)(x)
# output - 8
output = Dense(10, activation='softmax')(x)
custom_model = Model(inputs=model.input, outputs=output)
custom_model.compile(optimizer='adam', loss=keras.losses.SparseCategoricalCrossentropy(from_logits=True), metrics=['accuracy'])
custom_model.summary()
